import { Link } from "react-router-dom";

const DUMMY_EVENT = [
  { id: "e1", title: "Some event" },
  { id: "e2", title: "Another event" },
  { id: "e3", title: "Last event" },
];

function EventsPage() {
  return (
    <>
      <ul>
        <li>
          <Link to="/events/event-1">Event 1</Link>
        </li>
        <li>
          <Link to="/events/event-2">Event 2</Link>
        </li>
        <li>
          <Link to="/events/event-3">Event 3</Link>
        </li>
      </ul>
    </>
  );
}

export default EventsPage;
